import React from "react";

function importAll(r) {
    return r.keys().map(r);
}

function AllSvgLogo(){
  const images = importAll(require.context('../assets/img/svg', false, /\.(png|jpe?g|svg)$/));
  return(
    <div>
      {images.forEach((element,index) => {
        <div>
        <img src={images[index]}/>
        <p>hey</p>
        </div>
      })}
    </div>
  )
}
export default AllSvgLogo
